import {useSpring, animated} from 'react-spring'
const renderprops = import('react-spring/renderprops')

function Gallery() {
    return (
        <renderprops.Spring
  from={{ opacity: 0 }}
  to={{ opacity: 1 }}>
  {props => <div style={props}>hello</div>}
</renderprops.Spring>
    )
}

export default Gallery;
